import React from "react";
// import Iframe from "react-iframe";
// import { Container } from "../components/Grid";
// import Jumbotron from "../components/Jumbotron";

function Result() {
  return (
    <div style={{ width: "300px", margin: 0, padding: 0, border: 0 }}>
      <iframe 
       title={"badge"}
        src="http://www.budgetyourtrip.com/widgets/countrycostwidget.php?width=300"
        border={0}
        cellSpacing={0}
        style={{
          width: "400px",
          height: "400px",
          margin: 0,
          padding: 0,
          overflow: "hidden",
          border: 0
        }}
        frameBorder={0}
      />
      <div
        style={{
          fontSize: "x-small",
          fontFamily: "Arial, Tahoma, sans-serif",
          textAlign: "right",
          width: "300px",
          margin: 0,
          padding: 0
        }}
      >
        <a
          style={{ textDecoration: "none", color: "#999999" }}
          href="http://www.budgetyourtrip.com?r=widget"
          target="_blank"
          rel="noopener noreferrer"
        >
          Budget Your Trip
        </a>
      </div>
    </div>
  );
}

export default Result;
